import Foundation

enum FirstUniqueCharacterInAString {
    
    class Solution {
        func firstUniqChar(_ s: String) -> Int {
            var map: [Character: (firstIndex: Int, count: Int)] = [:]
        
            
            for index in 0..<s.count {
                let char = s[s.index(s.startIndex, offsetBy: index)]
                
                var entry = map[char, default: (-1, 0)]
                if entry.firstIndex == -1 {
                    entry.firstIndex = index
                }
                entry.count += 1
                map[char] = entry
            }
            
            let element = map.filter({ $0.value.count == 1 }).sorted(by: { $0.value.firstIndex < $1.value.firstIndex }).first
            return element != nil ? element!.value.firstIndex : -1
        }
    }
}

